import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { library } from '@fortawesome/fontawesome-svg-core'
import { fab } from '@fortawesome/free-brands-svg-icons'
import {  faGithub, faLinkedin } from '@fortawesome/free-brands-svg-icons'
// import { fas } from '@fortawesome/free-solid-svg-icons'
import { faUser } from '@fortawesome/free-solid-svg-icons'

library.add(fab, faGithub, faLinkedin, faUser)

class Footer extends React.Component {
    constructor (props) {
        super(props);
    }

  render() {
    return (
     <div className="footer">
      <a href="https://linkedin.com">
        <FontAwesomeIcon icon={['fab', 'linkedin']} className="socialIcons" size="lg"/>
      </a>
      <a href="https://github.com" className="footerLinks">
        <FontAwesomeIcon icon={['fab', 'github']} className="socialIcons" size="2x"/>     
      </a>
      <a href="https://jweaver.dev" className="footerLinks">
        <FontAwesomeIcon icon={'user'} className="socialIcons" size="xl"/>     
      </a>

    </div>
    );
  }
}

export default Footer;
